parts:
{
  "message_name": "UBX-NAV-SBAS",
  "class_id": "0x01",
  "message_id": "0x32",
  "message_type": "periodic_polled",
  "comment": "This message outputs the status of the SBAS sub system",
  "payload_length": {
    "variable": {
      "base": 12,
      "formula": "12 + cnt * 12"
    }
  },
  "fields": [
    {
      "byte_offset": 0,
      "data_type": "U4",
      "name": "iTOW",
      "unit": "ms",
      "description": "GPS time of week of the navigation epoch. See the description of iTOW for details."
    },
    {
      "byte_offset": 4,
      "data_type": "U1",
      "name": "geo",
      "description": "PRN Number of the GEO where correction and integrity data is used from"
    },
    {
      "byte_offset": 5,
      "data_type": "U1",
      "name": "mode",
      "description": "SBAS Mode",
      "value_description": [
        {
          "value": 0,
          "description": "Disabled"
        },
        {
          "value": 1,
          "description": "Enabled integrity"
        },
        {
          "value": 3,
          "description": "Enabled test mode"
        }
      ]
    },
    {
      "byte_offset": 6,
      "data_type": "I1",
      "name": "sys",
      "description": "SBAS System (WAAS/EGNOS/...)",
      "value_description": [
        {
          "value": -1,
          "description": "Unknown"
        },
        {
          "value": 0,
          "description": "WAAS"
        },
        {
          "value": 1,
          "description": "EGNOS"
        },
        {
          "value": 2,
          "description": "MSAS"
        },
        {
          "value": 3,
          "description": "GAGAN"
        },
        {
          "value": 16,
          "description": "GPS"
        }
      ]
    },
    {
      "byte_offset": 7,
      "data_type": "X1",
      "name": "service",
      "description": "SBAS Services available",
      "bit_fields": [
        {
          "bit_offset": 0,
          "num_bits": 1,
          "name": "ranging",
          "description": "GEO may be used as ranging source"
        },
        {
          "bit_offset": 1,
          "num_bits": 1,
          "name": "corrections",
          "description": "GEO is providing correction data"
        },
        {
          "bit_offset": 2,
          "num_bits": 1,
          "name": "integrity",
          "description": "GEO is providing integrity"
        },
        {
          "bit_offset": 3,
          "num_bits": 1,
          "name": "testmode",
          "description": "GEO is in test mode"
        },
        {
          "bit_offset": 4,
          "num_bits": 1,
          "name": "bad",
          "description": "Problem with signal or broadcast data indicated"
        }
      ]
    },
    {
      "byte_offset": 8,
      "data_type": "U1",
      "name": "cnt",
      "description": "Number of SV data following"
    },
    {
      "byte_offset": 9,
      "data_type": "X1",
      "name": "statusFlags",
      "description": "SBAS status flags",
      "bit_fields": [
        {
          "bit_offset": 0,
          "num_bits": 2,
          "name": "integrityUsed",
          "description": "SBAS integrity used",
          "value_description": [
            {
              "value": 0,
              "description": "Unknown"
            },
            {
              "value": 1,
              "description": "Integrity information is not available or SBAS integrity is not enabled"
            },
            {
              "value": 2,
              "description": "Receiver uses only GPS satellites for which integrity information is available"
            }
          ]
        }
      ]
    },
    {
      "byte_offset": 10,
      "data_type": {
        "array_of": "U1",
        "count": 2
      },
      "name": "reserved0",
      "reserved": true
    },
    {
      "byte_offset": 12,
      "data_type": "U1",
      "name": "svid",
      "description": "SV ID",
      "repeating_fields": {
        "count_field": "cnt",
        "block_size": 12
      }
    },
    {
      "byte_offset": 13,
      "data_type": "U1",
      "name": "reserved1",
      "reserved": true,
      "repeating_fields": {
        "count_field": "cnt",
        "block_size": 12
      }
    },
    {
      "byte_offset": 14,
      "data_type": "U1",
      "name": "udre",
      "description": "Monitoring status",
      "repeating_fields": {
        "count_field": "cnt",
        "block_size": 12
      }
    },
    {
      "byte_offset": 15,
      "data_type": "U1",
      "name": "svSys",
      "description": "System (WAAS/EGNOS/...) same as SYS",
      "repeating_fields": {
        "count_field": "cnt",
        "block_size": 12
      }
    },
    {
      "byte_offset": 16,
      "data_type": "U1",
      "name": "svService",
      "description": "Services available same as SERVICE",
      "repeating_fields": {
        "count_field": "cnt",
        "block_size": 12
      }
    },
    {
      "byte_offset": 17,
      "data_type": "U1",
      "name": "reserved2",
      "reserved": true,
      "repeating_fields": {
        "count_field": "cnt",
        "block_size": 12
      }
    },
    {
      "byte_offset": 18,
      "data_type": "I2",
      "name": "prc",
      "unit": "cm",
      "description": "Pseudo Range correction in [cm]",
      "repeating_fields": {
        "count_field": "cnt",
        "block_size": 12
      }
    },
    {
      "byte_offset": 20,
      "data_type": {
        "array_of": "U1",
        "count": 2
      },
      "name": "reserved3",
      "reserved": true,
      "repeating_fields": {
        "count_field": "cnt",
        "block_size": 12
      }
    },
    {
      "byte_offset": 22,
      "data_type": "I2",
      "name": "ic",
      "unit": "cm",
      "description": "Ionosphere correction in [cm]",
      "repeating_fields": {
        "count_field": "cnt",
        "block_size": 12
      }
    }
  ]
}
